import { useState, useEffect } from 'react';
import axios from 'axios';

function Leaderboard() {
  const [winners, setWinners] = useState([]);
  const [winnersPercentage, setWinnersPercentage] = useState([]);

  useEffect(() => {
    async function fetchWinners() {
      const response = await axios.get('/winners');
      setWinners(response.data);
    }

    async function fetchWinnersPercentage() {
      const response = await axios.get('/winnersPercentage');
      setWinnersPercentage(response.data);
    }

    fetchWinners();
    fetchWinnersPercentage();
  }, []);

  return (
    <div>
      <h1>Leaderboard</h1>
      <h2>Most Wins</h2>
      <table>
        <thead>
          <tr>
            <th>User ID</th>
            <th>Wins</th>
          </tr>
        </thead>
        <tbody>
          {winners.map((winner) => (
            <tr key={winner.userId}>
              <td>{winner.userId}</td>
              <td>{winner.wins}</td>
            </tr>
          ))}
        </tbody>
      </table>
      <h2>Best Win Percentage</h2>
      <table>
        <thead>
          <tr>
            <th>User ID</th>
            <th>Win Percentage</th>
          </tr>
        </thead>
        <tbody>
          {winnersPercentage.map((winner) => (
            <tr key={winner.userId}>
              <td>{winner.userId}</td>
              <td>{winner.winPercentage}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default Leaderboard;
